import React from "react";
import "./APIData.css";
const Data = (props) => {
  const listItems = props.result.map((element) => {
    return {
      from: element.from,
      to: element.to,
      value: element.value,
    };
  });
  console.log(listItems);
  return (
    <div>
      <li className="api">
        <h2>{listItems.from}</h2>
        <h3>{listItems.to}</h3>
      </li>
    </div>
  );
};
export default Data;
